import logo from './logo.svg';
import './App.css';

const App = () => {
  return (
    <div className="App">
      <div> <Header/></div>
      <ul>
        <li> css </li>
        <li> html </li>
        <li> js </li>
        <li> react </li>
      </ul>
    </div>
  );
}

const Header = () => {
  return (
    <div>
      <a>Home</a>
      <a>Hew Feed</a>
      <a>Massages</a>
    </div>
  );
}

export default App;
